import UserData from './components/UserData';

import React, { useState } from 'react';

function App() {


  let url = 'https://geektrust.s3-ap-southeast-1.amazonaws.com/adminui-problem/members.json';

  const [fetchedData, setUserDetails] = useState('');

  let usersDetails = [];

  try {
    setUserDetails(fetch(url));

    // Handle success
    fetchedData.then(response => {
      return response.json();
    })  // convert to json
      .then((data) => {

        for (let obj of data)
          usersDetails.push(obj);

      })

    // console.log(usersDetails);
  } catch (error) {
    console.log(error);

  }
  // console.log(usersDetails);
  // setUserDetails(usersDetails);

  return (
    <div>
      <input type='text' className='searchBox' placeholder="Search" />
      <UserData items={usersDetails}></UserData>

    </div>
  );
}

export default App;
